import {BrowserRouter as Router  , Switch , Route , Link , useRouteMatch , useParams } from 'react-router-dom';

function App() {
  return (
    <Router>
      <Switch>

        <Route path="/admin">
          <Customers />
        </Route>
        <Route path="/add">
          <AddUser />
        </Route>
        <Route path="/edit">
          <EditUser />
        </Route>
        <Route path="/">
          <Login />
        </Route>
      </Switch>
    </Router>
